import request from '@/utils/request'

const baseUrl = `/log/car/car`

export default {
    pageFind(page, limit, carPageParams) {    // 分页查看当前车库当中车辆信息
        return request({
            url: `${baseUrl}/pageFind/${page}/${limit}`,
            method: 'post',
            data: carPageParams
        })
    },

    saveCar(car) {    // 保存车辆信息
        return request({
            url: `${baseUrl}/saveCar`,
            method: 'post',
            data: car
        })
    },

    removeCarById(id) {
        return request({
            url: `${baseUrl}/removeCarById/`
        })
    }
}
